import {useNavigate} from 'react-router-dom'

const myIntro = () =>{
    const navigate = useNavigate() 
    const homwtown = () =>{
        navigate('/homwtown')
    }

    return <div>
        My introduction <button onClick={{homwtown}}>go hometown</button>
        </div>
}
export default myIntro;
